import React from 'react';
import { View, StyleSheet } from 'react-native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs'
import { HomeTab, NotificationTab, MessageTab, InboxTab, AvatarTab } from './'
import { createNativeStackNavigator } from '@react-navigation/native-stack';
// const Tab = createBottomTabNavigator()
const Stack = createNativeStackNavigator()
const TabNavigators = () => {
    return (
        <NavigationContainer>
            <Stack.Navigator styles={styles.navigatorWrapper}>
                <Stack.Screen name='home' component={HomeTab} />
                <Stack.Screen name='notification' component={NotificationTab} />
                <Stack.Screen name='message' component={MessageTab} />
                <Stack.Screen name='inbox' component={InboxTab} />
                <Stack.Screen name='avatar' component={AvatarTab} />
            </Stack.Navigator>
        </NavigationContainer>
        // <Tab.Navigator>
        //     <Tab.Screen name='home' component={HomeTab} options={false}/>
        //     <Tab.Screen name='notification' component={NotificationTab} />
        //     <Tab.Screen name='message' component={MessageTab} />
        //     <Tab.Screen name='inbox' component={InboxTab} />
        //     <Tab.Screen name='avatar' component={AvatarTab} />
        // </Tab.Navigator>
    );
}

const styles = StyleSheet.create({
    navigatorWrapper: {
        position: 'absolute',
        bottom: '20px',
        width: '95vw',
        height: '20px',
        backgroundColor: "#808080",
        flex: 1,
        flexDirection: 'row'
    }
})

export default TabNavigators;
